/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `insertEstacionamiento`(IN codplaca VARCHAR(8), IN cod_tareaje VARCHAR(25), IN coduser INT(5), IN lad VARCHAR(2), IN casilla INT(2))
BEGIN	
	
	
	INSERT INTO mpvehiculo	
	(idvehiculo, placa		,id_tareaje	,iduserreg	,horainicio	,horafinal			,idestado	,lado	,casillero,fecreg ) VALUES  
	(
	(
	SELECT CONCAT(IFNULL(LPAD(MAX(SUBSTRING(VE.idvehiculo,1,25))+1,25,'0'),LPAD('1',25,'0')), '-' , DATE_FORMAT(NOW(),"%Y"))
	FROM 	mpvehiculo VE
	WHERE 	SUBSTRING(VE.idvehiculo,27,5) 	= DATE_FORMAT(NOW(),"%Y")        
	AND 	DATE_FORMAT(VE.fecreg,"%Y") 	= DATE_FORMAT(NOW(),"%Y")
	)
	,codplaca	
	,cod_tareaje	
	,coduser	
	,NOW()		
	,ADDTIME(NOW()	
	, (
	SELECT CA.`tiempoparqueo`
	FROM `mp_tareaje` TA
	INNER JOIN `mp_cuadras` CU 	ON CU.`id_cuadras`=TA.`id_cuadras`
	INNER JOIN `mpcalle` CA 	ON CA.`codvia`=CU.`id_via` 
	INNER JOIN `mp_turno` TU	ON TU.`id_turno`=TA.`id_turno`
	WHERE TA.`fecha_tarea`=DATE_FORMAT(NOW(), "%Y-%m-%d") 
	aND TA.`iduser_parqueador`=coduser
	AND TU.`hora_ingreso` < TIME_FORMAT(NOW(), '%H:%i:%s')
	AND TU.`hora_fin`> TIME_FORMAT(NOW(), '%H:%i:%s')
	LIMIT 1 	
	))	
	,'1'
	,lad 
	,casilla
	,now());
	
	SELECT CONCAT(IFNULL(LPAD(MAX(SUBSTRING(VE.idvehiculo,1,25)),25,'0'),LPAD('1',25,'0')), '-' , DATE_FORMAT(NOW(),"%Y")) as ID
	FROM 	mpvehiculo VE
	WHERE 	SUBSTRING(VE.idvehiculo,27,5) 	= DATE_FORMAT(NOW(),"%Y") 
	AND 	DATE_FORMAT(VE.fecreg,"%Y") 	= DATE_FORMAT(NOW(),"%Y");
	
 END */$$
DELIMITER ;

/* Procedure structure for procedure `selectParqueado` */

/*!50003 DROP PROCEDURE IF EXISTS  `selectParqueado` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `selectParqueado`(IN iduser INT(6))
BEGIN
	SELECT VE.idvehiculo
	, VE.`placa`
	, VE.`horainicio`
	, VE.`horafinal`
	,TIMEDIFF(VE.`horafinal`,NOW()) as diferencia
	,iduserreg 
	FROM `mpvehiculo` VE
	INNER JOIN `mp_tareaje` TA ON TA.`id_tareaje`=VE.`id_tareaje`
	WHERE VE.`idestado`='1' AND VE.`iduserreg`=iduser;
 END */$$
DELIMITER ;

